//databases setups
const Enmap = require("enmap");
client.settings = new Enmap({
  name: "settings",
  dataDir: "./databases/settings",
});
client.setups = new Enmap({
  name: "setups",
  dataDir: "./databases/setups",
});
client.infos = new Enmap({
  name: "infos",
  dataDir: "./databases/infos",
});
client.jointocreatemap = new Enmap({
  name: "settings",
  dataDir: "./databases/jointocreatemap",
});

/// giveawat bot

// Initialise discord giveaways
const { GiveawaysManager } = require("discord-giveaways");
client.giveawaysManager = new GiveawaysManager(client, {
  updateCountdownEvery: 3000,
  default: {
    botsCanWin: false,
    embedColor: "#FF0000",
    reaction: "üéâ",
  },
});

/* Client's GiveawaysManager Events */
client.giveawaysManager.on(
  "giveawayReactionAdded",
  async (giveaway, reactor, messageReaction) => {
    if (reactor.user.bot) return;
    try {
      if (giveaway.extraData) {
        await client.guilds.cache
          .get(giveaway.extraData.server)
          .members.fetch(reactor.id);
      }
      reactor.send(
        new Discord.MessageEmbed()
          .setTimestamp()
          .setTitle("Entrada Confiramda!")
          .setDescription(
            `tue entrada a [este sorteo](https://discord.com/channels/${giveaway.guildID}/${giveaway.channelID}/${giveaway.messageID}) ha sido confirmada`
          )
          .setFooter("Mary Shop bot | Coded by ! SheepyCat#6011")
          .setTimestamp()
      );
    } catch (error) {
      const guildx = client.guilds.cache.get(giveaway.extraData.server);
      messageReaction.users.remove(reactor.user);
      reactor.send(
        new Discord.MessageEmbed()
          .setTimestamp()
          .setTitle(":x: Entrada Denegada | La base de datos no respondio!")
          .setDescription(
            `Trataste de entrar a [este sorteo](https://discord.com/channels/${giveaway.guildID}/${giveaway.channelID}/${giveaway.messageID}) ha sido denegada por un error **${guildx.name}**`
          )
          .setFooter("Mary Shop bot | Coded by ! SheepyCat#6011")
      );
    }
  }
);
// Check if user reacts on an ended giveaway
client.giveawaysManager.on(
  "endedGiveawayReactionAdded",
  (giveaway, member, reaction) => {
    reaction.users.remove(member.user);
    member.send(`**Este sorteo ya ha terminado**`);
  }
);
// Dm our winners
client.giveawaysManager.on("giveawayEnded", (giveaway, winners) => {
  winners.forEach((member) => {
    member.send(
      new Discord.MessageEmbed()
        .setTitle(`üéÅ Felicidades!!`)
        .setDescription(
          `Hola ${member.user}\n Has ganado **[[este sorteo]](https://discord.com/channels/${giveaway.guildID}/${giveaway.channelID}/${giveaway.messageID})**\n Ganaste **${giveaway.prize}!**\nDM/MD al host para reclamar tu premio!`
        )
        .setTimestamp()
        .setFooter(member.user.username, member.user.displayAvatarURL())
    );
  });
});
// Dm Rerolled winners
client.giveawaysManager.on("giveawayRerolled", (giveaway, winners) => {
  winners.forEach((member) => {
    member.send(
      new Discord.MessageEmbed()
        .setTitle(`üéÅ Felicidades!!, tenemos un nuevo ganador!`)
        .setDescription(
          `Hola ${member.user}\n Escuche que el host hizo reroll y tu ganaste **[[este sorteo]](https://discord.com/channels/${giveaway.guildID}/${giveaway.channelID}/${giveaway.messageID})**\n Ganaste **${giveaway.prize}!**\nDM/MD al host para reclamar tu premio`
        )
        .setTimestamp()
        .setFooter(member.user.username, member.user.displayAvatarURL())
    );
  });
});
// When They Remove Reaction
client.giveawaysManager.on(
  "giveawayReactionRemoved",
  (giveaway, member, reaction) => {
    return member.send(
      `‚ùì Espera, removiste la reaccion del sorteo??`
    );
  }
);


